                label="Most Active" 
                value="most-active" 
              />
            </Tabs>
          </Box>
        </Grid>

        <Grid item xs={12}>
          {activeTab === 'popular' && (
            <Paper elevation={1} sx={{ p: 0 }}>
              <Box sx={{ p: 2, borderBottom: '1px solid rgba(0, 0, 0, 0.12)' }}>
